import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Dashboard from './pages/Dashboard';
import Events from './pages/Events';
import MyEvents from './pages/MyEvents';
import Profile from './pages/Profile';
import ChangePassword from './pages/ChangePassword';
import EditProfile from './pages/EditProfile';
import BottomNav from './components/BottomNav';

function App() {
  const [searchTerm, setSearchTerm] = useState("");
  const [user, setUser] = useState({
    name: "Priya Sharma",
    email: "priya.sharma@university.edu",
    college: "Engineering Tech Institute",
    regNo: "ETI-2023-4589"
  });

  const [allEvents] = useState([
    { 
      id: 1, title: "Campus Tech Summit 2024", date: "Feb 15 路 10:00 AM", 
      location: "Main Auditorium", category: "Tech", 
      image: "https://images.unsplash.com/photo-1504384308090-c894fdcc538d?w=800" 
    },
    { 
      id: 2, title: "Annual Cultural Night", date: "Feb 22 路 6:30 PM", 
      location: "Open Air Theatre", category: "Cultural", 
      image: "https://images.unsplash.com/photo-1492684223066-81342ee5ff30?w=800" 
    }
  ]);

  const [registeredList] = useState([
    { id: 101, name: "Spring Tech Symposium", date: "Mar 18, 2024", venue: "Main Campus", ticketId: "ST-1842" }
  ]);

  const filteredEvents = allEvents.filter(event => 
    event.title.toLowerCase().includes(searchTerm.toLowerCase())
  );

  return (
    <Router>
      <div style={{ maxWidth: '375px', margin: '0 auto', backgroundColor: '#fff', minHeight: '100vh', position: 'relative' }}>
        <Routes>
          <Route path="/" element={<Dashboard user={user} events={filteredEvents} searchTerm={searchTerm} setSearchTerm={setSearchTerm} regCount={registeredList.length} />} />
          <Route path="/events" element={<Events events={allEvents} searchTerm={searchTerm} setSearchTerm={setSearchTerm} />} />
          <Route path="/my-events" element={<MyEvents registeredEvents={registeredList} />} />
          <Route path="/profile" element={<Profile user={user} />} />
          <Route path="/edit-profile" element={<EditProfile user={user} setUser={setUser} />} />
          <Route path="/change-password" element={<ChangePassword />} />
        </Routes>
        <BottomNav />
      </div>
    </Router>
  );
}

export default App;
